selector_to_html = {"a[href=\"barcode.html#msi-msi-plessey\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">MSI/MSI Plessey<a class=\"headerlink\" href=\"#msi-msi-plessey\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id73\" title=\"Link to this heading\">#</a></h3>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Keyboard Settings<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Case Settings<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"uhfmode.html#output-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Output Format<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><h3>ASCII (Hex)<a class=\"headerlink\" href=\"#ascii-hex\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#id1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">2D Symbologies<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#brazil-bank-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Brazil Bank Code<a class=\"headerlink\" href=\"#brazil-bank-code\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html#receiver-keyboard-transmission-speed1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Receiver Keyboard Transmission Speed<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#receiver-keyboard-transmission-speed1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#all-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">All Symbologies<a class=\"headerlink\" href=\"#all-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"uhfmode.html#uhf-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UHF Trigger Mode<a class=\"headerlink\" href=\"#uhf-trigger-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#aztec-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Aztec Code<a class=\"headerlink\" href=\"#aztec-code\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id87\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-39\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 39<a class=\"headerlink\" href=\"#code-39\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id28\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restore Default Settings<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>When an unknown error occurs on the scanner, you can reset the scanner by restoring the default settings.</p>", "a[href=\"system.html#sleep-time\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Sleep Time<a class=\"headerlink\" href=\"#sleep-time\" title=\"Link to this heading\">#</a></h2><p>By scanning the following setting code, you can set the scanner to enter sleep mode after a certain period of time when no code is scanned, so as to reduce power consumption.</p>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Continuous Mode<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>The scanner works continuously. If the scan is successful or the scan time exceeds the single working time, the current scan ends. If the time exceeds the specified time, the next scan is automatically triggered.</p>", "a[href=\"barcode.html#gs1-databar-rss\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1 DataBar/RSS<a class=\"headerlink\" href=\"#gs1-databar-rss\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id79\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Data Editing<a class=\"headerlink\" href=\"#data-editing\" title=\"Link to this heading\">#</a></h1><h2>Output Format<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>To change the Scan Data Transmission Format, scan one of the eight bar codes corresponding to the desired format.</p>", "a[href=\"barcode.html#pdf417\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">PDF417<a class=\"headerlink\" href=\"#pdf417\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id80\" title=\"Link to this heading\">#</a></h3>", "a[href=\"uhfmode.html#pass-through-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pass-through Mode<a class=\"headerlink\" href=\"#pass-through-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">1D Symbologies<a class=\"headerlink\" href=\"#d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#matrix-25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Matrix 25<a class=\"headerlink\" href=\"#matrix-25\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id55\" title=\"Link to this heading\">#</a></h3>", "a[href=\"working.html#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Storage Mode<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Data Upload<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"bluetooth.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Bluetooth Mode<a class=\"headerlink\" href=\"#bluetooth-mode\" title=\"Link to this heading\">#</a></h1>", "a[href=\"faq.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">FAQ<a class=\"headerlink\" href=\"#faq\" title=\"Link to this heading\">#</a></h1><h2>Question 1: The scan is successful, the buzzer sounds once, but no data is uploaded?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong> The scanner has entered storage mode and needs to scan <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Normal Mode</span></a> to recover.</p>", "a[href=\"barcode.html#data-matrix-dm\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Data Matrix(DM)<a class=\"headerlink\" href=\"#data-matrix-dm\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id83\" title=\"Link to this heading\">#</a></h3>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">End Character Settings<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>The end character is added after the decoded data in the format of decoded data + end character.</p>", "a[href=\"barcode.html#standdard-25-iata-25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Standdard 25/IATA 25<a class=\"headerlink\" href=\"#standdard-25-iata-25\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id61\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">One-to-One Pairing<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Link to this heading\">#</a></h2>", "a[href=\"uhfmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">UHF Setting<a class=\"headerlink\" href=\"#uhf-setting\" title=\"Link to this heading\">#</a></h1><h2>Module Selection<a class=\"headerlink\" href=\"#module-selection\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#block-barcodes-with-urls\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Block Barcodes With URLs<a class=\"headerlink\" href=\"#block-barcodes-with-urls\" title=\"Link to this heading\">#</a></h2><p>Block scanning of URL QR codes starting with <code class=\"docutils literal notranslate\"><span class=\"pre\">http://</span></code>, <code class=\"docutils literal notranslate\"><span class=\"pre\">https://</span></code></p>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Terminator<a class=\"headerlink\" href=\"#terminator\" title=\"Link to this heading\">#</a></h1><h2>End Character Settings<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>The end character is added after the decoded data in the format of decoded data + end character.</p>", "a[href=\"barcode.html#composite\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">COMPOSITE<a class=\"headerlink\" href=\"#composite\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id98\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#battery-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Battery Information<a class=\"headerlink\" href=\"#battery-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#interleaved-2-of-5-itf\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Interleaved 2 of 5/ITF<a class=\"headerlink\" href=\"#interleaved-2-of-5-itf\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id43\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#issn\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">ISSN<a class=\"headerlink\" href=\"#issn\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id90\" title=\"Link to this heading\">#</a></h3><p>Convert to EAN13 when disabled</p>", "a[href=\"barcode.html#ean-13\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-13<a class=\"headerlink\" href=\"#ean-13\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id14\" title=\"Link to this heading\">#</a></h3>", "a[href=\"faq.html#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1: The scan is successful, the buzzer sounds once, but no data is uploaded?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong> The scanner has entered storage mode and needs to scan <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Normal Mode</span></a> to recover.</p>", "a[href=\"barcode.html#ean-8\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">EAN-8<a class=\"headerlink\" href=\"#ean-8\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id9\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Get Firmware Version<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#gs1-128-ucc-ean-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">GS1-128 (UCC/EAN-128)<a class=\"headerlink\" href=\"#gs1-128-ucc-ean-128\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id22\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#upc-e\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-E<a class=\"headerlink\" href=\"#upc-e\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id3\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#maxi-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Maxi Code<a class=\"headerlink\" href=\"#maxi-code\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id86\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Key Trigger Mode<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Press the button to trigger scanning, and release the button to end scanning. Scanning ends when the scan is successful or the reading time exceeds the single reading time.</p>", "a[href=\"scanmode.html#same-code-delay-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Same Code Delay Settings<a class=\"headerlink\" href=\"#same-code-delay-settings\" title=\"Link to this heading\">#</a></h2><p>To prevent the same barcode from being scanned multiple times in <a class=\"reference internal\" href=\"#continuous-mode\">Continuous Mode</a> and <a class=\"reference internal\" href=\"#auto-sensing-mode\">Auto Sensing Mode</a>, you can require the scanner to wait for a set delay before allowing the same barcode to be scanned.</p>", "a[href=\"barcode.html#codabar\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Codabar<a class=\"headerlink\" href=\"#codabar\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id67\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 128<a class=\"headerlink\" href=\"#code-128\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id20\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#ds-8500-wireless-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><strong>DS-8500</strong> Wireless Scanner Quick Setup Guide<a class=\"headerlink\" href=\"#ds-8500-wireless-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Keyboard Language<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Get Current Keyboard Language<a class=\"headerlink\" href=\"#get-current-keyboard-language\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#code-93\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 93<a class=\"headerlink\" href=\"#code-93\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id33\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Auto Sensing Mode<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>In the auto sensing mode, the scanner will detect the brightness of the surrounding environment. When the brightness changes, the scan is triggered. The scan ends when the scan is successful or the scan time exceeds the single working time. Regardless of whether the last scan was successful or failed, the brightness of the surrounding environment will be detected again.</p>", "a[href=\"faq.html#question-5-scan-successful-uploaded-data-incorrect\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 5:Scan successful, uploaded data incorrect?<a class=\"headerlink\" href=\"#question-5-scan-successful-uploaded-data-incorrect\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong></p>", "a[href=\"process.html#suffix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Suffix<a class=\"headerlink\" href=\"#suffix\" title=\"Link to this heading\">#</a></h2><h3>Add Suffix<a class=\"headerlink\" href=\"#add-suffix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#medium-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Medium Speed<a class=\"headerlink\" href=\"#medium-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Wireless Mode<a class=\"headerlink\" href=\"#wireless-mode\" title=\"Link to this heading\">#</a></h1><p>This mode uses the 2.4GHz frequency band for data transmission and relies on radio frequency (RF) technology, which connects to the computer via a USB receiver and allows the scanner to move freely within a certain distance.</p>", "a[href=\"barcode.html#code-32\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 32<a class=\"headerlink\" href=\"#code-32\" title=\"Link to this heading\">#</a></h2><h3>Convert Code 39 To Code 32 (Italian Pharmaceutical Code)<a class=\"headerlink\" href=\"#convert-code-39-to-code-32-italian-pharmaceutical-code\" title=\"Link to this heading\">#</a></h3><p>Code 32 is a variation of Code 39 used by the Italian pharmaceutical industry. Scan the appropriate bar code below to enable or disable the conversion of Code 39 to Code 32.</p>", "a[href=\"barcode.html#d-reverse-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">1D Reverse Symbologies<a class=\"headerlink\" href=\"#d-reverse-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"faq.html#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 3:The scanner scans successfully, beeps three times, and fails to upload data. How can I solve this problem?<a class=\"headerlink\" href=\"#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong></p>", "a[href=\"faq.html#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 4:The scanner beeps five times when a button is pressed. How can I solve this problem?<a class=\"headerlink\" href=\"#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong> The battery is low and needs to be charged before it can be used again.</p>", "a[href=\"working.html#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Normal Mode<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#code-11\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Code 11<a class=\"headerlink\" href=\"#code-11\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id37\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Scan Mode<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Key Trigger Mode<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Press the button to trigger scanning, and release the button to end scanning. Scanning ends when the scan is successful or the reading time exceeds the single reading time.</p>", "a[href=\"wireless.html#high-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">High Speed<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Volume Settings<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Scan the corresponding setting code to turn on/off the sound prompt of the scanner</p>", "a[href=\"process.html#output-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Output Format<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>To change the Scan Data Transmission Format, scan one of the eight bar codes corresponding to the desired format.</p>", "a[href=\"uhfmode.html#module-selection\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Module Selection<a class=\"headerlink\" href=\"#module-selection\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html#case-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Case Settings<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>Normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#nec-25-coop25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">NEC-25(COOP25)<a class=\"headerlink\" href=\"#nec-25-coop25\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id91\" title=\"Link to this heading\">#</a></h3>", "a[href=\"faq.html#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2:The scanner scans successfully, beeps twice, and can upload data normally. What is going on?<a class=\"headerlink\" href=\"#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\" title=\"Link to this heading\">#</a></h2><p><strong>Answer:</strong> The battery of the scanner gun is low and it prompts that it needs to be recharged.</p>", "a[href=\"barcode.html#bookland-ean-isbn\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Bookland EAN(ISBN)<a class=\"headerlink\" href=\"#bookland-ean-isbn\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id19\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#upc-a\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">UPC-A<a class=\"headerlink\" href=\"#upc-a\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#enable-disable\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#hide-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Hide Set<a class=\"headerlink\" href=\"#hide-set\" title=\"Link to this heading\">#</a></h2><h3>Hide Barcode Start Chars<a class=\"headerlink\" href=\"#hide-barcode-start-chars\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#appendix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Appendix<a class=\"headerlink\" href=\"#appendix\" title=\"Link to this heading\">#</a></h2><h3>Numeric Bar Codes<a class=\"headerlink\" href=\"#numeric-bar-codes\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Symbologies<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>All Symbologies<a class=\"headerlink\" href=\"#all-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#han-xin-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Han Xin COde<a class=\"headerlink\" href=\"#han-xin-code\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id88\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#digital-barcode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Digital Barcode<a class=\"headerlink\" href=\"#digital-barcode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#isbt-128\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">ISBT 128<a class=\"headerlink\" href=\"#isbt-128\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id27\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#low-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Low Speed<a class=\"headerlink\" href=\"#low-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#prefix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Prefix<a class=\"headerlink\" href=\"#prefix\" title=\"Link to this heading\">#</a></h2><h3>Add Prefix<a class=\"headerlink\" href=\"#add-prefix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">System Settings<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Restore Default Settings<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>When an unknown error occurs on the scanner, you can reset the scanner by restoring the default settings.</p>", "a[href=\"character.html#transmit-code-id-character\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Transmit Code ID Character<a class=\"headerlink\" href=\"#transmit-code-id-character\" title=\"Link to this heading\">#</a></h2><p>A code ID character identifies the code type of a scanned bar code. This can be useful when decoding more than one code type. The code ID character is inserted between the prefix character (if selected) and the decoded symbol.</p>", "a[href=\"barcode.html#discrete-2-of-5-industrial-2-of-5-ind25\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Discrete 2 of 5/Industrial 2 of 5/IND25<a class=\"headerlink\" href=\"#discrete-2-of-5-industrial-2-of-5-ind25\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id49\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html#qr-code\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">QR Code<a class=\"headerlink\" href=\"#qr-code\" title=\"Link to this heading\">#</a></h2><h3>Enable/Disable<a class=\"headerlink\" href=\"#id81\" title=\"Link to this heading\">#</a></h3>", "a[href=\"working.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Working Mode<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>In the working area outside the range of the 2.4G receiver or Bluetooth signal, you can activate the storage mode of the scanner by following the steps described below. In this mode, all scanned data will be stored directly in the scanner. Before uploading the data, it will be permanently saved in the scanner so that you can upload the data when the scanner is in the receiving signal range.</p>", "a[href=\"process.html#quick-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Quick Setup<a class=\"headerlink\" href=\"#quick-setup\" title=\"Link to this heading\">#</a></h2><h3>Add Prefix<a class=\"headerlink\" href=\"#id3\" title=\"Link to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
